import React from 'react';
import { IonIcon, IonGrid, IonRow, IonCol } from '@ionic/react';
import ReactDOM from 'react-dom'
import { arrowBackCircleOutline, arrowForwardCircleOutline, } from 'ionicons/icons'

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee, faPlay, faBackward, faForward } from '@fortawesome/free-solid-svg-icons'


interface MeadiaPlayerProps { }

const MediaPlayer: React.FC<MeadiaPlayerProps> = () => {
  return (
      <div>
          <IonGrid>
              <IonRow>
                  <IonCol size="1">
                      <FontAwesomeIcon size="2x" icon={faBackward} />
                  </IonCol>
                  <IonCol size="1">
                      <FontAwesomeIcon icon={faPlay} />
                  </IonCol>
                  <IonCol size="1">
                      <FontAwesomeIcon icon={faForward} />
                  </IonCol>
              </IonRow>
          </IonGrid>
      </div>
  );
};

const MediaController: React.FC<MeadiaPlayerProps> = () => {
    return (
        <div></div>
    );
};

export default MediaPlayer;
